import * as React from "react";

import Navbars from "../Navbar/navbarHome";
import Footer from "../Footer/Footer";
import { useNavigate, useLocation } from "react-router-dom";

import { data, data2, data3, data4, data5 } from "../Data/data";
import { FaUserCircle } from "react-icons/fa";
import {
  IconButton,
  Input,
  TextField,
  Autocomplete,
  Box,
  FormControlLabel,
  Checkbox,
  Stack,
  Rating,
} from "@mui/material";

import { MdArrowDropDown } from "react-icons/md";

import Fileimg from "../../Images/file.png";

import {
  CustomerEN,
  //  CustomerDE,
  //  CustomerTH
} from "../Data/DataLanguage";

import "./Customer.css";

const Customer = () => {
  const { innerWidth: width, innerHeight: height } = window;
  const location = useLocation();
  const navigate = useNavigate();
  let Doc = location?.state?.languages;

  const [type, settype] = React.useState(null);
  const [trantype, setTranstype] = React.useState("");
  const [textarea, setTextarea] = React.useState("");
  const [price, setPrice] = React.useState("");
  const [tranfrom, setTranfrom] = React.useState("");
  const [tranto, setTranto] = React.useState("");
  const [file, setFile] = React.useState("");
  const [promo, setPromo] = React.useState("");
  const [checked, setChecked] = React.useState({
    checked1: false,
    checked2: false,
    checked3: false,
    checked4: false,
    checked5: false,
  });

  const handleChange = (event) => {
    setTextarea(event.target.value);
  };

  React.useEffect(() => {
    window.scrollTo(0, 0);
  }, []);

  const set_price = (trantype) => {
    // console.log("trantype :", typeof trantype);
    if (trantype === "Article") {
      setPrice("15 $");
    } else if (trantype === "Identification Card") {
      setPrice("20 $");
    } else if (trantype === "Family Status Registration") {
      setPrice("25 $");
    } else if (trantype === "Personal information") {
      setPrice("35 $");
    } else if (trantype === "Civil Registration Certificate") {
      setPrice("45 $");
    } else if (trantype === "Certificate of use (the noun prefix") {
      setPrice("55 $");
    } else if (trantype === "") {
      setPrice("0 $");
    } else {
      setPrice("100 $");
    }
  };

  const promotion = (x) => {
    setPromo(x);
    window.scrollTo(0, 1500);
    set_price(trantype);
  };

  const goSignup = () => {
    navigate("/Signup");
  };

  const cutsting = (x) => {
    console.log(x);
    return x.slice(0, 30);
  };

  return (
    <>
      <header className="App-header">
        {Doc === undefined ? (
          <Navbars navigate={navigate} languages="English" />
        ) : Doc === "Thai" ? (
          <Navbars navigate={navigate} languages="Thai" />
        ) : Doc === "German" ? (
          <Navbars navigate={navigate} languages="German" />
        ) : (
          <Navbars navigate={navigate} languages="English" />
        )}
      </header>

      <>
        <div className="fram1">
          <div style={{ display: "flex", justifyContent: "center" }}>
            <div
              style={{
                textAlign: "center",
                justifyItems: "center",
                // width: 1100,
                display: "inline-grid",
                position: "relative",
                top: 125,
              }}
            >
              <div>
                <p
                  style={{
                    fontWeight: "bold",
                    fontSize: 56,
                    color: "#FFFFFF",
                  }}
                >
                  {CustomerEN[0].label}
                </p>
              </div>
              <div className="textCustomerH">
                <p style={{ fontSize: 23, color: "#FFFFFF", width: "80vw" }}>
                  {CustomerEN[1].label}
                </p>
              </div>
              <div
                style={{
                  position: "relative",
                  top: 40,
                }}
              >
                <button className="fram1_button2">Subscribe</button>
              </div>
            </div>
          </div>
        </div>

        <div
          style={{
            width: width,
            height: 800,
          }}
        >
          <div>
            <div
              style={{
                textAlign: "center",
                marginBottom: 10,
              }}
            >
              <p className="textHeading2_overviwe">YOUR ORDER</p>
            </div>

            <div>
              {file === "" ? (
                <div
                  style={{
                    position: "absolute",
                    left: width * 0.08,
                    width: 415,
                    height: 570,
                    background: "#FFFFFF",
                    border: "1px solid #E5E5E5",
                    boxSizing: "border-box",
                    float: "left",
                    borderRadius: 20,
                    boxShadow: "0px 4px 8px rgba(0, 0, 0, 0.04)",
                    display: "flex",
                    alignItems: "center",
                    justifyContent: "center",
                  }}
                >
                  <label htmlFor="icon-button-file">
                    <Input
                      accept="image/*"
                      id="icon-button-file"
                      type="file"
                      style={{ display: "none" }}
                      onChange={(e) => setFile(e.target.value)}
                    />
                    <IconButton
                      color="primary"
                      aria-label="upload picture"
                      component="span"
                    >
                      <img
                        src={Fileimg}
                        alt="Fileimg"
                        className="BsFileEarmarkFill"
                      />
                    </IconButton>
                  </label>
                </div>
              ) : (
                <div
                  style={{
                    position: "absolute",
                    left: width * 0.08,
                    width: 415,
                    height: 570,
                    background: "#FFFFFF",
                    border: "1px solid #E5E5E5",
                    boxSizing: "border-box",
                    float: "left",
                    borderRadius: 20,
                    boxShadow: " 0px 4px 5px rgba(0, 0, 0, 0.1)",
                    display: "flex",
                    alignItems: "center",
                    justifyContent: "center",
                  }}
                >
                  <label htmlFor="icon-button-file">
                    <Input
                      accept="image/*"
                      id="icon-button-file"
                      type="file"
                      style={{ display: "none" }}
                      onChange={(e) => setFile(e.target.value)}
                    />
                    <IconButton
